const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Lancer</li><li>True Name: Minamoto no Raikou</li><li>Sex: Female</li><li>Sources: Historical Fact, \u201COtogizoushi (Fairy-Tale Books)\u201D, \u201CThe True Form of Ushi-Gozen\u201D, etc. / Dead Heat Summer Race!</li><li>Region: Japan</li><li>Alignment: Lawful Good</li><li>Height: 175cm</li><li>Weight: ??kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Sakurai Hikaru</li><li>Character Designer: Honjou Raita</li><li>Character Voice: Tomatsu Haruka</li><li>Major Appearances in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">A+</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magical Resistance: C</strong></p><p>Nullifies Magecraft spells that were done with a chant of two verses or below. Cannot defend against large-scale Magecraft such as Great Magecrafts and Ritual Spells.</p><p><strong>Riding: A+</strong></p><p>One can freely handle all beasts and vehicles except Dragon Kins.</p><p>Raikou being able to ride is because of the Deity Gozu Tennou.</p><p><strong>Madness Enhancement: C</strong></p><p>A Skill that strengthens one\u2019s physical abilities in exchange for their sense of reason.</p><p>Although that mentality is still broken to some extent even though Raikou got into the Lancer Class, there is a big difference when compared to the time she was a Berserker. That is to say, the presence of a sense of morals. With her moral sense, Lancer Minamoto no Raikou looks out for disorders in the public morals of the summer holidays. But as she is relatively indifferent to her very own appearance for instance, the signs of a broken mind still cannot be completely erased from her\u2026</p><p><strong>Divinity: C</strong></p><p>Raikou was born as the heaven-sent child of Gozu Tennou, so she possesses the Divinity Skill.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Mental Pollution: B</strong></p><p>The person in question has personally stated that she does not have this Skill, but it in fact remains with her.</p><p><strong>The Shadow Public Morals Committee\u2019s Chairwoman: A</strong></p><p>An altered Skill of Eternal Martial Arts Mastery.</p><p>No matter what kind of situation it is, Raikou will not overlook a disorder of the public morals. Even if she lost her sailor uniform\u2026</p><p><strong>Wrought Iron Wheelbarrow: C</strong></p><p>\u201CWhen one speaks of sailor uniforms, it has to be this\u201D \u2013 such is Kintoki\u2019s subjective impression which ended up infecting Raikou. Raikou, who embodies every single martial art, perfectly handles a wrought iron yo-yo, using it to drive away every single summer temptation that tries to corrupt Chaldea\u2019s public morals.</p><p><strong>Summer Catastrophe: EX</strong></p><p>It is already amazing even without taking them off\u2014\u2014\u2014\u2014but it becomes even more amazing when she takes them off.</p><p>A Skill falsely similar to Summer Crisis[1], demonstrating how many looks one ends up gathering from other people at the beach. Unlike Beach Flower, it even focuses the gazes that deviate from the sphere of affectionate yearning onto oneself.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="shakudai-kan-in-\u2013-kongousho-sakra-devanam-indra-s-diamond-pounder" tabindex="-1"><a class="header-anchor" href="#shakudai-kan-in-\u2013-kongousho-sakra-devanam-indra-s-diamond-pounder" aria-hidden="true">#</a> Shakudai Kan\u2019in \u2013 Kongousho (\u015Aakra Dev\u0101n\u0101\u1E43 Indra\u2019s Diamond Pounder)</h1><ul><li>Rank: A+</li><li>Classification: Anti-Personnel Noble Phantasm / Anti-Army Noble Phantasm</li><li>Range: 1~100</li><li>Maximum Number of Targets: 1 person / 220 people</li></ul><p>The Diamond Pounder of Gozu Tennou \u2013 also known as the Oriental Deity Taishakuten (Indra) \u2013 namely, a Vajra \u2013 the ultimate weapon of the gods that was made from sacred sacral bones \u2013 comes down from the skies and annihilates all the enemies\u2014\u2014\u2014\u2014Because of this Noble Phantasm, Raikou\u2019s Class ultimately gets to be established as Lancer at this occasion. Its shape is that of a tokkosho[2], which is said to represent the single Tath\u0101t\u0101, the substance of all things in creation as taught in the Vajrayana.</p><p>Arjuna: \u201CThat Noble Phantasm is father\u2019s\u2026\u201D</p><p>Rama: \u201CThat Noble Phantasm is\u2026\u201D</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First Person Pronoun: watashi</li><li>Second Person Pronouns: anata / anata [only to females]</li><li>Third Person Pronoun: ano kata</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>In order to enforce the public morals, Raikou changed into the Shadow Public Morals Committee\u2019s Chairwoman. Her catchphrase is \u201CProhibited, prohibited, absolutely prohibited!\u201D She has become much more serious than usual. She has no interest in the outcome of the race that Ishtar is holding, and she is purely intending to monitor the participants whom appear to be waiting for an opportunity provided by the summer event to act without too much restraint.</p><p>Eventually, Raikou\u2019s spirits will rise and she will end up throwing her sailor uniform off, causing a situation where she will be the one who is completely corrupting the public morals the most without meaning to\u2026 and yet to the person herself, she really has no self-awareness. Or, does she\u2026?</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Towards the Master, Raikou persistently comes into contact with them with committee chairwoman moves such as \u201CListen, you must not be too immersed in liberal thoughts just because it is summer, am I clear?\u201D</p><p>\u201CBut, um, President, it\u2019s in sight\u2026 That, er\u2026 That slit in your skirt is very bold of you\u2026 More than anything, that\u2019s quite the terrific swimsuit underneath your sailor uniform\u2026\u201D</p><p>\u201C? What happened?\u201D</p><p>\u201CAs expected, she really is unaware!\u201D</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CLancer, Minamoto no Raikou. I am the Shadow Public Morals Committee\u2019s Chairwoman who protects Chaldea\u2019s public morals. There is already relief here now that I came, Master. I will by no means overlook any wicked deed!\u201D</p><p>\u201CThe Public Morals Committee is power. Power itself is the Public Morals Committee. You comprehend, right?\u201D</p><p>\u201CDo you understand? You understand, right? You must not corrupt the public morals!\u201D</p><p>\u201CTo those who corrupt the public morals! You will be purged!\u201D</p><p>\u201CProhibited, prohibited, absolutely prohibited!\u201D</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>Raikou began to pay an undue amount of attention to the public morals. The very same person as Berserker Raikou.</p><p>\u25C6</p><p>Raikou heard of a considerable amount of disorders in the public morals that happened last time during summer on the Southern Island. \u201CThis year\u2019s event must not become a situation of that sort again\u201D \u2013 she personally gave such a prayer to Gozu Tennou and forced a Class Change on herself. Even if they were not to the degree seen when she is a Saber \u2013 which is her rightful Class \u2013 she at least achieved a transformation into Lancer Minamoto no Raikou in which her maternal power was moderated and her disposition in protecting the capital was strengthened.</p><p>\u201CYo, Raikou-san will become unbelievably serious as a Saber when it consists of her main job. A Public Morals Committee\u2019s Super Chairwoman.\u201D</p><p>\u201CIf it\u2019s Lancer\u2026 I know, I can describe the position as a \u2018Shadow Public Morals Committee\u2019s Chairwoman\u2019, yeah? You might say, in other words\u2014\u2014\u2014\u2014\u201D</p><p>In other words, a leader of a female gang.</p><p>While her maternal power is still moderated, Raikou, as the gallant warrior who protects the capital, cuts through the summer!</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Xuanzang Sanzang</strong></p><p>Raikou, who concluded with \u201CThey are making the summer event festive\u201D, \u201CThat is proof\u201D and \u201CThey already changed into swimsuits in Chaldea\u201D, declares to Xuanzang Sanzang, \u201CIf you want to be rehabilitated, come along with me, and that will undoubtedly conform to the great intentions of the Honourable Buddha as well, do you not agree?\u201D</p><p>Xuanzang Sanzang, who cannot help but feel the divine protection of the gods from Raikou, turned out to be in very high spirits, saying \u201CThis isn\u2019t particularly a swimsuit, but interesting! I wanna see what you\u2019ll do!\u201D, and entered into the race together with Raikou.</p><p><strong>Swimsuit Servants / Kiara / Medb</strong></p><p>\u201CProhibited, because those are too shameless!\u201D</p><p><strong>Boudica</strong></p><p>\u201CYour provocative attire is very much prohibited. I had been thinking of such since long ago.\u201D</p><p><strong>Scheherazade</strong></p><p>\u201CNeedless to say, prohibited, prohibited, absolutely prohibited!\u201D</p><p><strong>Nitocris (Swimsuit)</strong></p><p>\u201CIt is OK if it is only your Saint Graph\u2019s First Stage.\u201D</p><p><strong>Fran (Swimsuit)</strong></p><p>\u201CIt is OK during the race.\u201D (Because Fran shows little exposure at the time of running the race, it is OK to Raikou.)</p><p>But given that it is a swimsuit attire if Fran is outside of the race, Raikou\u2019s response becomes \u201CNot good. Leaving too many gaps is not good of you, so properly cover up the spots that should be hidden!\u201D</p><p><strong>Shuten-douji</strong></p><p>An oni who is the same as the source that corrupts the public morals. \u201CHey, your existence is prohibited!\u201D</p><p><strong>Oni Servants</strong></p><p>\u201COni and the like are the embodiment of the disorders in the public morals.\u201D</p><p><strong>Arthur</strong></p><p>\u201CA gentleman suitable for the Shadow Public Morals Committee.\u201D</p><p><strong>Sakata Kintoki (Berserker)</strong></p><p>\u201CI am worried. Given that I am now the Shadow Public Morals Committee\u2019s Chairwoman, the number of times I conduct myself as a mother just like usual has decreased. Please, I hope you do not do things such as turning yourself to delinquency.\u201D</p><p><strong>Sakata Kintoki (Rider)</strong></p><p>\u201CThat hairstyle\u2026 did you become a delinquent by some chance!?\u201D</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>When I received a request for Ms. Swimsuit Raikou, I wondered if it was okay? \u201COkay, I\u2019m worried, because even notwithstanding that BODY under normal circumstances, it\u2019ll become a serious matter if I undress her!! I don\u2019t know if I should continue anymore!\u201D Then, when I was having fun drawing her freely, it resulted in a finish like this. The highlight of her design is Sukeban Raikou from her Second Stage since I wanted to do a costume that has impact, but I wonder if I somewhat overdid it by having decided on a considerably aggressive choice? And, when I was nervously trying to propose her character sheet, I unexpectedly received the OK, and I was elated; I got them to grant all sorts of selfish requests of mine such as the yo-yo attacks and the submarine pitch for her Noble Phantasm direction, and there was nothing but gratitude from me! Thank you very much, truly!! (Honjou Raita)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL Notes:</h2><p>[1] \u2013 Should have been Beach Crisis instead of Summer Crisis.</p><p>[2] \u2013 A tokkosho is a type of Vajra, a pestle with a single sharp blade at each end.</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-316.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-316.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-316.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-316.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-320.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-321.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-322.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-323.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-324.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-325.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-326.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-327.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 105);
